VALUES ('3440434000004', 'Saumon fumé', 'SAUMON FUMÉ ÉLEVÉ EN NORVÈGE Le saumon de l\'Atlantique (Salmo Salar) est l\'espèce la plus recherchée pour ses qualités gustatives. Le saumon de Norvège provient de ces eaux pures et claires où les poissons sont élevés dans des conditions idéales. Ses qualités nutritionnelles, son appétissante couleur et sa délicieuse saveur en font un aliment d\'exception. La chair du saumon, comme celle du maquereau et du hareng, est source d\'acides gras oméga 3 et polyinsaturés. Notre savoir faire Filetés à la main et salés au sel sec, les saumons sont ensuite séchés et fumés lentement à froid, au bois de hêtre. Le tranchage et le soin apporté au conditionnement sont les dernières étapes de préparation de nos saumons fumés. Afin d\'apprécier pleinement notre saumon fumé, nous vous conseillons d\'ouvrir l\'emballage 10 minutes avant dégustation.', 'https://static.openfoodfacts.org/images/products/344/043/400/0004/front_fr.4.400.jpg', '10', '2.5', '0.9', '0.8', '', '22', '2.5', '0.984251968503937', '', '0');

